#!python3

import subprocess
import argparse
import sys
import time
import datetime

ts = time.time()
stringTime = datetime.datetime.fromtimestamp(ts).strftime('%m%d%y_%H%M%S')
reportName = 'duckHuntReport_{}.html'.format(stringTime)

### Initial Values
parser = argparse.ArgumentParser()
parser.add_argument('-f', help='Runs a full search of deep web data', action='store_true')
parser.add_argument('-p', help='Runs a search of deep web data containing phone numbers', action='store_true')

if len(sys.argv) < 2:
    parser.print_help()
    sys.exit(1)
    
args = parser.parse_args()


##Checking Args
if args.f:
    print  ('[+] Running full deep web search')
    location_file = 'index_locations.txt'
else:
    pass
    
if args.p:
    print  ('[+] Running search of deep web data with Phone Numbers')
    location_file = 'index_locations_phones.txt'
else:
    pass



print ("Duck Hunt")



    
def main():
    report_file = open('.\\reports\\{}'.format(reportName),  mode='w', encoding='utf8')
    report_file.write('<html>')
    report_file.write('<img src="data:image/png;base64,"')
    with open('search_terms.txt', 'r') as search_terms:
        for search_item in  search_terms:
            report_file.write('</n></n><p>[+] Searching for: <b>{}</b> </p><hr>'.format(search_item))
            search_item = search_item.strip('\r\n')
            with open(location_file, 'r') as index_locations:
                for current_index_location in index_locations:
                    report_file.write('<p><hr><i>[+] Searching: {} </i></p>'.format(current_index_location))
                    current_index_location = current_index_location.strip('\r\n')
                    print (current_index_location)
                    print ('Searching for {} within {}'.format(search_item, current_index_location ))
                    subprocess.call('C:\\Program Files\\Mythicsoft\\FileLocator Pro\\flpsearch.exe -idxpath {} -cez -c {} -o ".\\reports\\temp.txt" '.format(current_index_location, search_item ))  #-oa -o ".\\reports\\beep.txt"was-cee
                    with open('.\\reports\\temp.txt',  mode='r', encoding='ISO-8859-1') as tempResults:  ##changed encoding on 12/16 thanks to this link: https://stackoverflow.com/questions/19699367/for-line-in-results-in-unicodedecodeerror-utf-8-codec-cant-decode-byte
                        for line in tempResults:
                            print(line)
                            report_file.write('<p> {} </p>'.format(line).replace(search_item, '<b>{}</b>'.format(search_item)))
                            
    report_file.write('</html>')
            
if __name__ == '__main__':
    main()